const fullName = $json.Person || '';
const parts = fullName.trim().split(' ');

return {
  json: {
    firstName: parts[0] || '',
    lastName: parts.slice(1).join(' ') || '',
  },
};

for (const item of $input.all()) {
  const person = item.json.Person || '';
  const company = item.json.Company || '';
  const combined = `${person}  ${company}`; // два пробіли між
  const encoded = encodeURIComponent(combined);
  item.json.encodedResult = encoded;
}
return $input.all();

const url = $input.first().json.social_links.LinkedIn[0] || '';
const match = url.match(/linkedin\.com\/company\/([^\/?#]+)/i);
const companySlug = match ? match[1] : '';

return [
  {
    json: {
      companySlug: companySlug
    }
  }
];
